import './App.css';
import { useState, useEffect } from "react";
import { Routes, Route } from 'react-router-dom';
import Main from './components/pages/Main';
import References from './components/pages/References';
import Header from './components/layouts/Header';
import Footer from './components/layouts/Footer';
import Elado from './components/pages/Elado';
import MostEpul from './components/pages/MostEpul';
import ReferenceDetail from './components/ReferenceDetail';

function App() {
  const [mostEpul, setMostEpul] = useState({});
  useEffect(() => {
    fetch("https://api-eu-central-1.graphcms.com/v2/ckwq5z05y2e8n01xmgomm92ka/master?query=%23%20Welcome%20to%20GraphiQL%0A%23%0A%23%20GraphiQL%20is%20an%20in-browser%20tool%20for%20writing%2C%20validating%2C%20and%0A%23%20testing%20GraphQL%20queries.%0A%23%0A%23%20Type%20queries%20into%20this%20side%20of%20the%20screen%2C%20and%20you%20will%20see%20intelligent%0A%23%20typeaheads%20aware%20of%20the%20current%20GraphQL%20type%20schema%20and%20live%20syntax%20and%0A%23%20validation%20errors%20highlighted%20within%20the%20text.%0A%23%0A%23%20GraphQL%20queries%20typically%20start%20with%20a%20%22%7B%22%20character.%20Lines%20that%20starts%0A%23%20with%20a%20%23%20are%20ignored.%0A%23%0A%23%20An%20example%20GraphQL%20query%20might%20look%20like%3A%0A%23%0A%23%20%20%20%20%20%7B%0A%23%20%20%20%20%20%20%20field(arg%3A%20%22value%22)%20%7B%0A%23%20%20%20%20%20%20%20%20%20subField%0A%23%20%20%20%20%20%20%20%7D%0A%23%20%20%20%20%20%7D%0A%23%0A%23%20Keyboard%20shortcuts%3A%0A%23%0A%23%20%20Prettify%20Query%3A%20%20Shift-Ctrl-P%20(or%20press%20the%20prettify%20button%20above)%0A%23%0A%23%20%20%20%20%20Merge%20Query%3A%20%20Shift-Ctrl-M%20(or%20press%20the%20merge%20button%20above)%0A%23%0A%23%20%20%20%20%20%20%20Run%20Query%3A%20%20Ctrl-Enter%20(or%20press%20the%20play%20button%20above)%0A%23%0A%23%20%20%20Auto%20Complete%3A%20%20Ctrl-Space%20(or%20just%20start%20typing)%0A%23%0A%0A%7B%0A%20%20mostEpuls%20%7B%0A%20%20%20%20id%0A%20%20%20%20title%0A%20%20%20%20picture%20%7B%0A%20%20%20%20%20%20id%0A%20%20%20%20%20%20fileName%0A%20%20%20%20%7D%0A%20%20%20%20%0A%20%20%7D%0A%7D%0A%0A")
      .then(res => res.json())
      .then(json => setMostEpul(json));
  }, [])


  // let i = 0
  // while(i < 100) {
  //   const num = () => {return Math.floor(Math.random() * 9) + 1};
  //   let coupon = `${num()}${num()}${num()}${num()}-${num()}${num()}${num()}${num()}-${num()}${num()}${num()}${num()}-${num()}${num()}${num()}${num()}`
  //   i++
  // }

  console.log(mostEpul)
  return (
    <div>
        <Header />
        <Routes>
            <Route exact path='/' element={<Main />}/>
            <Route path='/referenciak' element={<References />}/>
            <Route path='/referenciak/:project' element={<ReferenceDetail />}/>
            <Route path='/most-epul' element={<MostEpul />}/>
            <Route path='/elado' element={<Elado />}/>
        </Routes>
        <Footer />
    </div>
  );
}

export default App;
